(26, 4, 'จริงครับแต่มันจะค่อยเป็นค่อยไปเร็วหรือช้าขึ้นอยู่กับพื้นดวงของแต่ละคน แต่ที่จะเห็นได้เร็วคือ เรื่องการเงิน ประมาณ 7วัน ถึงไม่เกิน 2เดือน แล้วแต่อาชีพงานครับ เพราะเรื่องนี้ผมได้ทดลองกับตัวเอง - ครอบครัว - ญาติ - เพื่อนๆ และขยายกลุ่มคนกว้างขึ้นมาก่อนแล้วผมถึงได้เปิดเว็ปครับ', 'พรพิฆเณศว์', '2011-07-28 16:34:53'),
