(42, 6, 'ตัองขอโทษที่ตอบช้าครับ ผมไม่ทราบว่าคุณเกิดวันพุธกลางวันหรือวันพุธกลาวงคืนเอาเป็นว่าผมตอบไป2อย่างเลยแล้วกัน แต่จริงๆแล้ว ควรบอกตัวอักษรหน้าตัวเลขมาให้ผมด้วย\r\n1. คนเกิดวันพุธ (กลางวัน) \r\n-  ตามหลักทักษาคนที่เกิดวันพุธ (กลางวัน) ห้ามใช้ จ ฉ ช ซ ฌ ญ เพราะเป็นอักษรกาลกิณี\r\n-  เลขทะเบียนรถห้าม ไม่ให้มีเลข ๓ และเลข ๘\r\nรถสีเทา สีบรอนซ์\r\nเสริมความสงบปลอดภัยจากเหตุร้าย เช่น อุบัติเหตุ แคล้วคลาดจากอันตรายทั้งปวง \r\n\r\n2.คนเกิดวันพุธ (กลางคืน) \r\n-  ตามหลักทักษาคนที่เกิดวันพุธ (กลางคืน) ห้ามใช้ บ ป ผ ฝ พ ฟ ภ ม เพราะเป็นอักษรกาลกิณี\r\n-  เลขทะเบียนรถห้าม ไม่ให้มีเลข ๕ และเลข ๔\r\nรถสีเทา สีบรอนซ์\r\nเสริมความสงบปลอดภัยจากเหตุร้าย เช่น อุบัติเหตุ แคล้วคลาดจากอันตรายทั้งปวง \r\n\r\nแต่หากถามว่าภาพรวมของตัวเลขโดยรวมของทะเบียนคันนี้ถือว่าดี โดยเฉพาะ เรื่องการเงินและการงานเพราะดูง่ายๆคุณเป็นรักสวยรักงามมากถือว่าเป็นคนสุขนิยมคนหนึ่งเลยเชียวหละส่วนเรื่องเงินก็ไม่เคยขาดมือ\r\n', 'พรพิฆเณศว์', '2011-08-23 12:54:56'),
