(41, 11, 'ไม่เลยครับจะยิ่งหนักขึนเสียด้วยซำ เพราะถ้าเบอร์หนึ่งเสียเรื่องหนึ่ง ส่วนอีกเบอร์ก็เสียอีกเรื่องหนึ่ง ก็จะกลายเป็นว่ามีจุดบอดอยู่หลายจุด จะทำให้เราเหนื่อยมากขึ้นแล้วก็มีปัญหาเยอะขึ้นมากด้วย', 'พรพิฆเณศว์', '2011-08-23 12:38:54'),
