(112, 24, 'ตอบครับ\r\nจะมีผลเห็นชัดกับคนที่ถือเบอร์เป็นประจำมากกว่า ส่วนคนที่จดทะเบียน จะมีผลบางๆ เพราะเบอร์ผูกกับชื่อเรา เช่น หากลูกยังเรียนอยู่ \r\n1. ถือเบอร์ที่เสีย ก็จะทำให้ผลการเรียนของเด็กไม่ดีเท่าที่ควร เพราะเด็กอาจติดเกมส์ หรือ ไม่ก็ใช้เงินเก่ง ถูกเพื่อนแกล้งเป็นประจำ หรือเอาแต่ใจเป็นต้น\r\n2. ถือเบอร์ที่ดี ไม่มีข้อเสียเลย ก็จะเป็นเด็กที่เรียนดี เป็นที่รักและใว้ใจของครู และผู้ใหญ่ สอนงาย มารยาทดี เป็นต้น\r\n  ทั้งนี้ขึ้นอยู่กับตัวเลขนั้นๆที่เขาถือ หากสงสัยเพิ่มเติมโทรถามตรงใด้ที่ 0851951999 หรือ 0896959469 ครับ', 'พรพิฆเณศว์ ', '2012-02-28 22:09:47'),
