(113, 4, 'สอบถามคะ___เบอร์ที่เปลี่ยนใหม่ให้เปอร์เซ็นสูงเช่น 98.30....สามารถเปลี่ยนหรือทำให้เกิดผลสำเร็จ มากกว่า หรือ น้อยกว่า...ดวงของคนใช้ในระดับไหนคะ......ปล.ที่ถามเพราะอยากทราบในศาสตร์ของคุณไม่ได้ตั้งใจลบหลู่นะคะ พอดีชอบเสริมสิ่งดีๆ ให้ชีวิต และมีประสบการณ์เปลี่ยนเบอร์มาแล้วแต่ใช้ศาสตร์รวมตัวเลขได้ผลรวมโอเค แต่พอเช็คศาสตร์ของคุณเบอร์ไม่ดีเลย ที่สำคัญซื้อมา 3500 บาทเสียดายตังค์นิดๆ เลยอยากเช็คชัวร์ๆอะคะ.......ขอบคุณล่วงหน้าสำหรับคำตอบ......noo_tpe@hotmail.com', 'จิรปรียา', '2012-03-05 23:22:29'),
