(118, 11, 'แล้วถ้าเลือกแล้วเป็นเบอร์ดีทุกเบอร์ ไม่มีข้อเสียเลย แต่ใช้ 3 เบอร์ล่ะคะ จะมีข้อเสียไหมคะ (คือพกตลอด 3 เบอร์เลยอ่ะค่ะ)', 'ชบาแก้ว', '2012-05-17 16:48:53'),
(119, 11, 'ตอบคุณชบาแก้ว\r\nใช้ได้ครับจะดีด้วยซ้ำ เพราะ ทั้ง3เบอร์จะช่วยไปเสริมซื่งกันและกัน เช่นจะทำให้งานนั้นๆไปได้รื่น แต่อย่างไรก็ตาม หากคุณมีโอกาศ ได้เบอร์มาใหม่ ให้เอาเบอร์ที่ได้มา ไปกดดูคำทำนายหากตัวอักษรในคำทำนายเป็นสีแดง ไม่ว่าจะอยู่ในตำแหน่งใหนก็ตาม ก็ให้ทิ้งซะอย่าไปอยากได้กับแค่โปรฯถูก เพราะนั่นคืออุปสรรคในชีวิตจะมีเข้ามา \r\nหากอยากทราบรายระเอียดเพิ่มเติม โทรถามผมตรงได้เลยครับที่ 0851951999 หรือ 0896959469 ปรึกษาฟรีไม่มีค่าใช้จ่ายครับ', 'พรพิฆเณศว์ ', '2012-05-17 17:20:14'),
(120, 0, '', '', '2012-05-20 14:46:21'),
(121, 25, 'ขอบคุณมากครับกับคำขอบคุณ จริงแล้วจุดประสงของพี่(ผมเอง) ที่ทำเรื่องเบอร์ก็แค่ต้องการให้คนที่ได้มีโอกาศได้รู้จักกับพี่มีชีวิตที่ดีขึ้น ใช้ชีวิตให้มีความสุขขึ้น เท่านี้พี่ก็สุขใจแล้ว ขอขอบคุณอีกครั้งกับคำขอบคุณที่มีให้มาด้วยใจ', 'ป๋วย  พรพิฆเณศว์', '2012-06-23 21:34:23'),
(122, 26, 'ดีมากๆเลยละครับหากเบอร์นี้เป็นของคุณให้คุณจดทะเบียนใว้ซะแล้วใช้เป็นเบอร์หลักมันจะทำให้ชีวิตคุณดีอยู่ตลอดทั้งเครดิตชื่อเสียงสภาพคล่องอีกทั้งเรื่องแคล้วคลาดก็ดีผู้ใหญ่ก็เอ็นดูมีอย่างเดียวที่ช้าคือเรื่องการแต่งงาน แต่ถ้าแต่งแล้วชีวิตจะมั่นคงมากๆ ขอบอก หากต้องการจะถามรายละเอียดเพิ่มเติมโทรถามได้เลยครับที่ 085-195-1999 ได้เลยครับ', 'พรพิฆเณศว์', '2012-08-16 21:38:52'),
(123, 27, 'อย่างที่บอกครับเบอร์เก่าคุณดีกว่านี้เยอะ อย่าเอามาใช้คู่กันเพราะเบอร์นี้มีจุดบอด(ข้อเสีย)อยู่1จุด ฉนั้น ให้เอบเบอร์นี้ไปแก้ให้กับแม่ เพราะเบอร์แม่คุณเสียมาก หรือไม่ก็ให้กับญาติหรือใครก็ได้ ที่เบอร์เขาเสียมากๆ อยุ่น้อยจะช่วยผ่อนหนักเป็นเบา และจะช่วยให้การดำเนินชีวิตเขาดีขึ้นและเป็นสุขมากขึ้นครับ ขอบอก', 'พรพิฆเณศว์', '2012-09-27 00:08:24'),
(125, 24, 'ลูกสาวกำลังเรียนอยู่ ม.6 เขาใช้เบอร์ 090-4659141 เขาไม่ชอบเบอร์นี้เลย เขาร้องจะเอาเบอร์ของแม่ 084-5535565 คุณช่วยแนะนำหน่อยซิคะว่าเหมาะสมมั๊ย ไม่รู้จะพูดอย่างไรกับลูกดี (เบอร์ที่เขาใช้มีคนซื้อให้เป็นของขวัญค่ะ)', 'นลิน', '2012-09-28 11:37:51'),
