(244, 80, 'ผมไม่ใช่อาจารย์นะ\r\nแต่เท่าที่ผมได้โทรคุยคือ อาจารย์บอกประมาณว่าผลรวม ตัวเราไม่ต้องสนใจ\r\nข้อนี้ผมลองเอาเบอร์ของคนรอบข้างมาลองรวมดู\r\nหลายคนผลรวมดีแต่เจอปัญหาเยอะพอๆกับผมเลย เบอร์ผมผลรวมก็ดีนะลองบวกดูแล้ว(บวกแบบรวม10หลัก) แต่\r\nไม่เห็นดีอย่างที่เว็บนั้นๆบอก ที่แปลกคือบางเว็บ\r\nบอกบวก 10หลัก บางที่8หลัก บางที่ 7หลัก\r\nเลยไม่รู้ว่ายังไงเหมือนกัน\r\n\r\nอีกเรื่องคือเบอร์ที่เราถือแม้จะไม่มีตัวแดงแต่ถ้าไม่ตรงกับอาชีพที่เราทำ พลังของตัวเลขจะช่วยเราคนละแบบ กับเบอร์ที่ตรงกับอาชีพของเรา\r\nประมาณว่าเกาไม่ถูกที่คัน (แต่เบอร์เก่าผมนี้ผลรวมดีแต่มีตัวแดง) ตามที่ผมเข้าใจนะ\r\nจากที่ผมฟังอาจารย์พยายามอธิบายและให้เบอร์\r\nผมมาเลือกเพราะตอนแรกผมเลือกอีกกลุ่มนึง\r\n\r\n\r\n\r\nถ้าจะให้ดีคือโทรถามอาจารย์ก่อนครับ เพราะอย่างของผม\r\nตอนแรกผมเข้ามาเลือกเบอร์แล้วกดจองซื้อกะจะไปโอนเงินเลย มาทราบตอนหลังจากคุยกับอาจารย์แล้วถึงทราบรายละเอียดย่อยๆ คือท่าน\r\nใส่ใจลูกค้า เอาเป็นว่าต้องโทรคุยเองครับถึงจะรู้', 'เกียรติศักดิ์', '2013-04-16 03:22:49'),
(245, 80, 'ปล.1ผมก็ไม่ทราบหลักการวิเคราะห์ของอาจารย์แต่ละท่านเช่นกันว่าเป็นเช่นไร แบบไหนถูกหรือไม่ถูกนั้นผมคงไม่สามารถบอกระบุชัดเจนได้ แต่ผมจะขอลองด้วยตนเองครับ ตอนนี้ผมรออาจารย์ติดต่อกับเหมือนกับคนอื่นๆท่านคงจะอธิบายรายละเอียดเพิ่มเติมอาจจะใช้เวลาในการติดต่อกับแต่ละคนคงเพราะอาจารย์น่าจะงานเยอะครับ\r\n', 'เกียรติศักดิ์', '2013-04-16 03:35:46'),
