(248, 80, 'ขอโทษที่ผมตอบช้าไปหน่อยครับ ให้คุณใช้ เบอร์ 0861549614 และจะทะเบียนใช้จนแก่ตาย แล้วก็ปิดเบอร์เดิมที่ใช้อยู่ 0856309962 ซะ เพราะเบอร์ที่ดีหากใช้คู่กับเบอร์ที่เสีย คุณลองดูก็ได้จะวุ่นวาย(เหนื่อยปล่าว)\r\n\r\nแล้วก็ขอขอบคุณ คุณเกียรติศักดิ์ ด้วยครับที่ช่วยแชร์ความรู้ให้กับเพื่อนๆ  อีกอย่าง ให้คุณ พัทธนันท์ เข้าไปดูขั้นตอนปฏิบัติหลังการเปลี่ยนเบอร์ จากหน้าแรกแล้วก็ไปทำตามนั้นซะ ชีวิตคุณจะดีเองครับ', 'พรพิฆเณศว์', '2013-04-21 01:24:33'),
