(272, 96, 'เห็นอาจารย์บอกว่าเบอร์เลือกเราก็ได้ครับไม่ได้เป็นที่เราหรือใครชอบเลขนั้นอย่างเดียว ประมาณว่าถ้าสื่อถึงกันวิ่งหากันเอง แต่ถ้าใครอยากจะให้มีลักษณะนั้น\r\nหรือลดความแรงลงไหม คงต้องโทรคุยกับทางอาจารย์โดยตรงครับที่เบอร์ \r\n\r\nMagicianNumber.com@gmail.com\r\nโทร.08-9695-9469 , 08-5195-1999\r\n\r\nสาเหตุที่โทรคุยจะดีกว่า เพราะรายละเอียดเยอะครับ แล้วอย่างของผมตอนที่\r\nโทรคุยกับอาจารย์พบว่าท่านแม่นจนผมอึ้งเลย\r\nคุณลองดูได้โทรคุยดีกว่าครับ จะได้ทราบแบบละเอียด', 'เกียรติศักดิ์', '2013-05-08 18:24:36'),
(273, 97, 'ถ้าจะดูแบบละเอียด ใส่เบอร์โทรในช่องว่างด้านขวาได้ครับ แต่ถ้าคุณจะดูแบบละเอียดของเบอร์ทั้งหมด\r\nโทรคุยกับท่านอาจารย์โดยตรงจะดีกว่าครับ\r\n\r\nเพราะท่านต้องใช้ข้อมูลอย่างอื่นของคุณด้วยครับ', 'เกียรติศักดิ์', '2013-05-08 18:32:11'),
