INSERT INTO `webboard_comment` (`wc_id`, `webboard_id`, `wc_content`, `wc_post`, `wc_date`) VALUES
(401, 194, 'สำหรับเรื่องหน้าที่การงานไม่แตกต่างกันเท่าใหร่ครับแตกต่างที่อารมนิดหน่อยครับแต่ไม่มากครับเบอร์หนึ่งบอกว่าชอบช่วยเหลือคนคุมลูกน้องได้แต่ก็นานๆทีก็แอบมีใจร้อนอยู่บ้าง ส่วนอีกเบอร์บอกว่าเป็นที่รักของทุกคนจึงมักมีคนคอยช่วยอยู่เสมอครับ', 'พรพิฆเณศว์', '2013-10-03 09:13:41'),
(402, 195, 'ปิดซะดีกว่าครับแค่คุณอ่านผมว่าคุณคงเห็นแล้วววว', 'พรพิฆเณศว์', '2013-10-05 00:28:43'),
(403, 193, 'เช็คเบอร์ให้หน่อยนะคะ เกิดวันจันทร์ เดือนกันยายน ปีกุนค่ะ ทำงานเป็นคนพูด สอนให้กับคนอื่นๆค่ะ ด้านวิชาการค่ะ เบอร์ 082-456-2295 ค่ะ ขอบคุณค่ะอาจารยฺ', 'ปัณณธร ฉวีทอง', '2013-10-05 11:30:34'),
(404, 193, '082-456-2295 เบอร์นี้ก็เช่นกันครับให้จดทะเบียนใช้จนแก่ตายกันไปข้างหนึ่งเลยครับ ตรงกับอาชีพคุณอยู่แล้วด้วย\r\nส่วนเรื่องวันเดือนปีเกิดกับการใช้เบอร์โทรนั้นไม่เกี่ยวกันเลยครับ วันเดือนปีเกิดให้ผลชัดเจนกับเรื่องชื่อของคุณเท่านั้นครับ', 'พรพิฆเณศว์', '2013-10-05 11:40:22'),
(405, 193, 'สวัสดีค่ะอาจารย์ หนูเป็นแม่บ้าน แต่อยากเริ่มทำธุรกิจส่วนตัวเล็กๆเกี่ยวกับขนม อบค่ะอาจารย์ ตอนนี้เหนื่อยมากกับการดูแลลูก มีปัญหาหนักใจตลอดเวลาเลยค่ะ สองสาวแนะนำให้เปลี่ยนเบอร์ หนูได้เบอร์ใหม่เป็น 080-4596429 เบอร์นี้ดีมั้ยคะอาจารย์ รบกวนช่วยเชคด้วยนะคะ ขอบพระคุณค่ะ', 'ภัคจิรา', '2013-10-05 14:49:46'),
(406, 196, 'เบอร์นี้ขอบอกว่า100%เต็มครับเพียงแต่ว่าเบอร์นี้ไม่มเหมาะที่จะใช้กับผู้หญิง(คนใช้เบอร์นี้เป็นผู้หญิง)เพราะเบอร์นี้เป็นเบอร์ของผู้ชาย(นารีอุปถัมภ์)ครับ', 'พรพิฆเณศว์', '2013-10-07 01:49:48'),
(407, 196, 'ขอบคุณค่ะ เบอร์ 088-9529624 แฟนใช้ค่ะ \r\nส่วนตัวนู๋เองใช้ 084-5469636 \r\n\r\nขอบคุณอาจารย์มากๆค่ะ ', 'ปรียาพร016', '2013-10-07 08:29:05'),
(408, 196, '0955644962เป็นยังไงบ้างค่ะ', '55', '2013-10-08 12:39:34'),
(409, 198, 'เบอร์นี้ 095-7893632  ทิ้งไปเลยครับ ส่วนที่เหลือใช้ได้หมดทุกเบอร์ครับ เว้นแต่หากคุณยังไม่ได้แต่งงาน เบอร์นี้ 086-6361965 ก็ไม่เหมาะที่จะใช้ครับ นอกนั้นชอบเบอร์ใหนใช้เบอร์นั้นได้เลยครับ', 'พรพิฆเณศว์', '2013-10-08 22:14:53'),
(410, 197, 'เข้าไปดูรายระเอียดได้ที่เวปผมอยู่แล้วนี่ครับ', 'พรพิฆเณศว์', '2013-10-08 22:16:52'),
(411, 199, 'จะดีได้ยังไงครับ เลขแบบนี้ 43281 คุณไปดูคำทำนายของผมดิที่ตัวอักษรเป็นสีแดงเยนใว้ว่าไงบ้าง ', 'พรพิฆเณศว์', '2013-10-10 23:27:49'),
(412, 201, '0924142926, 0924191516,เหมาะที่จะใช้เป็นเบอร์หลัก ที่เหลือเป็นเบอร์เสริมครับ', 'พรพิฆเณศว์', '2013-10-14 12:30:54'),
(413, 201, 'ขอบคุณค่ะ จองเรียบร้อยแล้วค่ะ', 'สวิส', '2013-10-14 12:58:21'),
(414, 202, 'ผมขอเบอร์ติดต่อกลับคุณดีกว่าจะได้คุยเรื่องรายระเอียดได้มากกว่าพิมพ์ครับหรือไม่ก็โทรหาผมตรงได้ที่0851951999 ไม่มีค่าใช้จ่ายอื่นไดด้วยครับ', 'พรพิฆเณศว์', '2013-10-14 22:39:45'),
(415, 202, 'ขอบพระคุณอาจารย์มากๆ นะค่ะ ที่ช่วยชี้แนะวิธีแก้ไขหลายอย่างๆ ดีจริงแม่นจริงค่ะ ขอบุญกุศลที่อาจารย์ช่วยชี้แนะ ขอให้อาจารย์และครอบครัวมีแต่ความสุขสมหวังทุกประการนะค่ะ', 'ทิพย์', '2013-10-15 11:01:15'),
(416, 201, 'เห็นอาจารย์แนะว่าควนเปลี่ยนชื่อ อยากทราบว่าถ้าเปลี่ยนเบอร์แล้วจำเป็นต้องเปลี่ยนชื่อมั้ยค่ะ เบอร์ดีช่วยพยุงดวงเราได้ในระดับนึงแทนการเปลี่ยนชื่อมั้ย หากว่าไม่อยากเปลี่ยน', 'สวิส', '2013-10-17 13:16:40'),
(417, 201, 'ขอบคุณสำหรับคำแนะนำค่ะ', 'สวิส', '2013-10-17 15:33:24'),
(418, 206, 'คุณอ่านเอาเองก็ได้นี่นาครับว่าเบอร์นี้ดีหรือไม่ ผมจะบอกให้อีกก็ได้ครับสำหรับผมแล้วให้ใช้คำทำนายเป็นหลัก หากเบอร์ใหนก็ตามถ้าตัวอักษรในคำทำนายมีเป็นตัวสีแดงแม้แต่ตัวเดียวก็ตามนั้นคือเบอร์เสียครับ เราพะมันจะทำให้ชีวิตคุณมีปัญหาในเรื่องนั้นๆครับ', 'พรพิฆเณศว์', '2013-10-24 23:16:09'),
(419, 208, 'มีผลเท่ากันครับเพราะตัวเลขมีเรื่องราวส่วนพอเป็นเบอร์โทรเปิดใช้/มีคลื่น/มีพลังงาน ต่อให้คุณคิดว่ามันไม่ได้ใช้โทร แต่ที่คุณใช้เน็ต มันก็เท่ากับใช้คลื่นอยู่ดีครับ อีกอย่างหากเบอร์ที่คุณใช้อยู่เป็นเบอร์ที่ดีอยู่แล้ว แล้วเบอร์นี้เป็นเบอร์ที่เสีย ผมจะบอกว่ามันจะทำให้เรายุ่งยากมากขึ้นครับ', 'พรพิฆเณศว์', '2013-10-30 07:22:16'),
(420, 183, 'อยากฃายเบอร์ที่เคยใช้แล้ว 087-8777885 รวมแล้วได้65 ถือว่าเป็นเลขดี สนใจโทร093-4297416', 'กานต์', '2013-11-07 20:01:30'),
