(422, 219, 'เรื่องตัวเลขกาลกิณีของวันเกิดไม่มีผลกับเบอร์โทรครับ(เป็นความเชื่อที่รู้มาไม่หมดครับ)ผมว่าเอางี้ดีกว่าครับผมว่าคุณโทรคุยตรงกับผมน่าจะอธิบายได้ละเอียดและกระจ่างกว่าพิมพ์ถามครับ เบอร์ผม 0851951999 0879919456 แล้วคุณจัชัดเจนครับ หรือไม่ก็ให้เบอร์ติดต่อกลับผมมาก็ได้ คุยตรงกับผมไม่ต้องกลัวว่าจะมีค่าใช้จ่ายเพิ่มเติม (ปรึกษาฟรีไม่คิดตังครับ )ขอบอก', 'พรพิฆเณศว์', '2013-11-13 01:23:11'),
