(428, 224, 'ตอนนี้คุณใช้เบอร์อะไรอยู่ครับบอกผมหน่อยผมจะได้โทรบอกคุณให้กระจ่างกว่าที่คุณรู้มาครับหรือไม่ก็โทรหาผมตรงที่0851951999 ได้ครับ', 'พรพิฆเณศว์', '2013-11-19 01:34:41'),
