(432, 228, 'ยังครับเพราะเสียที่ 77 เอาง่ายๆให้คุณดูในคำทำนาย หากเบอร์ไดมีตัวอักษรสีแดง(อยู่ในคำทำนาย)ก็ถือว่าเบอร์นั้นเป็นเบอร์ที่เสียครับ', 'พรพิฆเณศว์', '2013-11-21 07:02:12'),
(433, 228, 'ขอรบกวนหน่อยค่ะ ตอนนี้หนูใช้ อยู่2 เบอร์ค่ะ 085058464 เป็นเบอร์หลักเลยค่ะ หนูทำงานเกี่ยวกับค้าขายค่ะ แต่หนูมีความรู้สึกว่ายิ่งทำยิ่งไม้เห็นอะไรเลย หนูท้อมากค่ะ และก้อมีแต่คนคอยเอารัดเอาเปรียบ เห็นแก่ตัว หนูเจออย่างนี้มาคลิดเลยค่ะ หนูควรจะเลิกใช้เบอร์นี้ ใช่มั่ยค่ะ\r\nและ อีกเบอร์นึง คือ 0835696164 เบอร์นี้ดีหรือเปล่าค่ะ หนูขอีบกวนขอคำแนะนำหน่อยนะค่ะ ขอบพระคุณมากค่ะ', 'นันท์นภัส', '2013-11-26 11:03:45'),
(434, 219, 'อยากถามว่า พอจะมีเบอร๋โทรที่ไม่มี เลข 2 และ 4 ไหมค่ะ\r\nคือว่าดิฉันเกิดวันอังคารแล้วดูเลขแล้ว 2 ตัวนี้ไม่ดี', 'พิชชารัตน์  ตุ้ยกาศ', '2013-11-26 22:22:56'),
