(436, 229, 'เบอร์ที่คุณใช้เป็นเบอร์ที่ดีใช้ด้วยกันได้ทุกเบอร์ครับ เว้นแต่ว่าถ้าคุณอยู่ในสถานภาพโสดหรือม่ายละก็ 0836455699 และ 0859424636 ก็ไม่ควรใช้ครับ', 'พรพิฆเณศว์', '2013-11-30 05:37:35'),
