(439, 234, 'สองเบอร์นี้ให้จดทะเบียนใช้ไปจนคุณแก่เลยครับเบอร์ดีทั้งคู่เลยเลยใช้ด้วยกันได้และดีด้วยครับ', 'พรพิฆเณศว์', '2013-12-04 16:42:52'),
(440, 235, 'ให้คุณเลิกใช้ 0842115948 ซะด้วยหากคุณอยากสอบได้จริงๆครับ', 'พรพิฆเณศว์', '2013-12-05 07:19:32'),
(441, 237, 'ไม่มีผลเสียครับถึงเบอร์จะดูคล้ายกันแต่ก็ไม่เหมือนกันซะเลยทีเดียวครับใช้คู่กันได้ดีมากด้วยครับ', 'พรพิฆเณศว์', '2013-12-07 00:13:02'),
(442, 238, 'ผลรวมไม่มีผลครับเป็นแค่ความเชื่อครับ สำหรับเรื่องผลรวมใช้ได้ผลจริงก็เฉพาะชื่อและเลขที่บ้านครับ', 'พรพิฆเณศว์', '2013-12-09 01:25:15'),
(443, 240, 'ดีทั้ง2เบอร์เลยครับจดทะเบียนใช้จนแก่ตายไปข้างเลยครับ แต่มีข้อแม้อยู่ว่าหากใช้หลายเบอร์ละก็ เบอร์ใหนมีคำทำนายเป็นตัวอักษรสีแดงให้ปิดซะแล้วใช้แต่เบอร์เหล่านี้ก็พอถมเถไปแล้วครับ', 'พรพิฆเณศว์', '2013-12-13 21:41:39'),
(444, 241, 'ปิดซะทั้งคู่ครับ', 'พรพิฆเณศว์', '2013-12-14 21:48:17'),
(445, 243, 'ผมว่าเรื่อนี้โทรปรึกษาผมตรงดีกว่าครับคุณจะได้ข้อมูบที่ถูกต้องไม่ต้องเดาเพราะที่คุณถามมามันกว้างกว่าที่จะพิมพ์คุยกันครับโทรที่0851951999 ได้เลยครับ', 'พรพิฆเณศว์', '2013-12-18 19:01:54'),
(446, 244, 'ก็ฝากข้อความตอบรับใว้ที่เบอร์เก่าว่าคุณเปลี่ยนเบอร์ไปใช้เบอร์ใหม่ดิครับ หรือถ้าไม่เข้าใจโทรคุยกับผมตรงได้เลยครับ ที่ 0851951999', 'พรพิฆเณศว์', '2013-12-18 19:04:18'),
