(712, 372, 'ก็เพราะว่าหลักการที่คุณคำนวณมันผิดน่ะซิครับ.....ผมจะบอกว่าไอ้ความรู้ที่คุณรู้หรือเรียนมาเนี่ยมันใช้กับเบอร์โทรศัทพท์ และเรื่องอื่นๆอีหลายเรื่องไม่ได้เลยครับ...วิธีคำนวนไม่เหมือนกันโดยสิ้นเชิงครับ...อีกอย่างการที่จะเรียนรู้เรื่องพวกนี้หากจะให้รู้จริงต้องใช้เวลานานและต้องช่างสังเกตุ...ทดลอง...และตามผลอย่างจริงๆจังครับไม่ใช่เรียนจบแล้วประกอบอาชีปได้เลยเหมือนอย่างที่เขาโฆษณากันซะที่ใหน...มันต้องใช้เวลาในการค้นคว้านาน(ขึ้นอยู่กับบุญกรรมของคนๆนั้น)บางคนไม่กี่ปีก็เนียน....บางคนศึกษาทั้งชีวิตยังไม่เข้าใจ....แต่วิธีที่ดีที่สุดคือ....\"อย่างให้น้ำมันเต็มแก้วครับ\" เพราะมันจะได้เติมอยู่เรื่อยๆได้ครับ', 'พรพิฆเณศว์', '2014-06-19 00:08:28'),
