(808, 438, 'จดฯใช้ยาวไปเลยครับ แล้วถ้ามีเบอร์ที่เสีย(ในคำทำนายมีอักษรเป็นสีแดง)ก็ปิดซะด้วยนะครับอย่าเอามาใช้หรือพกด้วยกัน', 'พรพิฆเณศว์', '2014-09-24 22:25:40'),
