(811, 427, '0889599193 เบอร์นี้มีต่อผลชีวิตใดบ้างครับ\r\nตอนนี้ทำธุรกิจขายของอินเตอร์เนตและซื้อขายหุ้นและทำงานประจำฝ่ายบุคคล', 'วราวิชญ์', '2014-09-30 10:49:48'),
(812, 442, 'จดใช้ 0989969562 ยาวไปเลยครับ ส่วน 0932466636 0932466196 ปิดทิ้งไปซะครับ แล้วก็อย่าลืมปิดเบอร์อื่นที่เสียเสีด้วยนะครับ....แม้แต่เบอร์ที่ใช้กับแท็บเล็ต(ไม่ได้ใช้โทร)ก็มีผลเช่นเดียวกันครับ', 'พรพิฆเณศว์', '2014-10-01 17:27:41'),
(813, 443, '1.096-1455953 \r\nใช้ไดเแค่เบอร์เดียวเองครับ นอกนั้นเสียหมดครับ ส่วน  085-0479459 ถ้าจะเลิกก็อย่าเพื่งไปปิดครับ เพราะเป็นเบอร์ที่ดี มีจุดบอดนิดหน่อย(ไม่แรงและแก้ได้ด้วย)เพียงแต่ไม่เหมาะก้บเด็กหรือผู้ใหญ่ที่ต้องใช้ตอมพ์ฯประจำเท่านั้นเอง ให้เอาไปให้ใครก็ได้ เช่นญาติหรือเพื่อนหรือลูกน้องบริวารที่เราเห็นว่าเบอร์เขาเสีย(ในคำทำนายเบอร์โทรของคนๆนั้นมีตัวอักษรเป็นสีแดง)ใช้ชีวิตเขาก็จะดีขึ้นเอง ส่วนเราก็จะได้กุศลด้วยนะครับ', 'พรพิฆเณศว์', '2014-10-02 09:26:12'),
(814, 444, 'ใช้ได้ทั้งคู่เลยครับ  097-954-1545 สวย แต่ถ้าหลากหลาย 096-1455953 ดีกว่าครับ แต่ผมว่าใช้ทั้งคู่ไปเลยครับเบอร์ดีๆแบบนี้หายกอยู่แล้วครับ', 'พรพิฆเณศว์', '2014-10-02 23:29:11'),
(815, 0, '', '', '2014-10-05 16:45:22'),
