(818, 448, 'ถ้าเบอร์เหล่านี้มันมีอยู่ในมือคุณอยู่แล้ว\r\n1.0809599529 ให้เอาไปให้ญาติหรือเพื่อนที่เป็นผู้ชายใช้จะดีกว่า\r\n2. 099-041-9364, 083-696-4144 สองเบอร์นี้ถ้าคุณยังโสดหรืออยู่ในสถานภาพโสด ก็ไม่สมควรใชัครับ แต่เป็นเบอร์ที่ดี เพราะถ้ามีครอบครัวอยู่แล้ว 083-696-4144 ดีกว่า 099-041-9364(ถ้าคุณโสดก็ให้เอาสองเบอร์นี้ไปให้ญาติหรือเพื่อนที่เขาอยู่ในสถานภาพ สมรสใช้ อย่าทิ้งไปเฉยๆ\r\n3.จดใช้ยาวไปเลยครับ', 'พรพิฆเณศว์', '2014-10-09 22:10:00'),
