(826, 462, 'เรื่องเงินไม่บอกชัดเจนครับเพียงแต่เบอร์นี้เป็นเบอร์ที่ดีเด่นเรื่องงานและครดิตชื่อเสียงและการประสานงาน/อสังหา ละอื่นอีกหลายเรื่องคุณเข้าไปอ่านดูคำทำนายเองได้อยู่แล้วนี่ครับ....ยังไงซะมันก็เป็นเบอร์ที่ดีใช้ไปเถอะครับ แล้วก็อย่าลืมปิดเบอร์ที่เสียซะด้วยนะครับ(ใช้คู่กันมันจะเหนื่อย)', 'พรพิฆเณศว์', '2014-10-31 22:23:52'),
(827, 463, '1. 093-6915632 ปิดทิ้งไปได้เลยครับ\r\n2. 093-9594563 ถ้าตอนี้คุณอยู่ในสถานภาพโสด ก็ไม่ควรใช้ครับเพราะความรักจะไม่ลงตัว แต่ถ้าอยู่ในสถานภาพสมรส ก็จะใชัได้ดีมากเหมือนกันครับ\r\n3. 090-9499564และ 090-5646442 จดใช้ยาวไปได้เลยครับ\r\n\r\n\r\n', 'พรพิฆเณศว์', '2014-10-31 22:29:02'),
(828, 464, '2เบอร์นี้เป็นเบอร์ที่ดีทั้งคู่ และความหมายใกล้เคียงกันมาดแตกต่างอยู่นิดหน่อยเท่านั้น ถ้าเป็นผม จะเก็บใว้ทั้งคู่ หรือหากจำเป็นต้องเลือกจริงๆผมจะใช้วิธีเลือกจากชะตาตัวเองเป็นหลัก เช่น จับฉลาก(ให้เบอร์เลือกคนดีกว่า เพราะเรื่องแบบนี้ ปกติเลขจะเลือกคนเองเพราะตัวเลขจะเห็นชะตาเราก่อนที่เราเองจะรู้ชะตาตัวเองเสมอครับ)', 'พรพิฆเณศว์', '2014-10-31 22:37:41'),
(829, 465, 'โอเคเลยครับแต่ต้องทิ้งเบอร์เก่าที่เสียให้หมดนะครับ', 'พรพิฆเณศว์', '2014-11-01 22:54:38'),
(830, 467, 'ไม่ต้องปิดหรอกครับควรเอาไปให้้เพื่อนหรือญาติหรือลูกน้องใช้ดีกว่า เพียงแต่ว่าถ้าจะเอา 0865146922 ไปให้เขา คนๆนั้นต้องเป็นผู้หญิงเท่านั้นเองครับ', 'พรพิฆเณศว์', '2014-11-03 07:25:47'),
(831, 466, 'ผมว่าโทรถามผมตรงที่ 0851951999 จะได้รายระเียดชัดเจนกว่าพิมพ์ครับ', 'พรพิฆเณศว์', '2014-11-03 07:27:35'),
