(837, 471, 'ลองตั้งกระทู้ใหม่ถามอาจารย์ดูนะคะ เพราะกระทู้ไหนที่อาจารย์ตอบแล้วท่านไม่น่าจะเข้ามาอีก\r\nแต่ได้ยินมาว่า เลข 25 คือเลขนารีอุปถัมภ์ค่ะ\r\nหากเราเป็นนารีใช้เอง ก็คงต้องได้อุปถัมภ์บุรุษค่ะ', 'panda', '2014-11-07 10:56:57'),
