(839, 474, 'ถ้าคุณอยากมีโอกาศได้หาเลี้ยงสามีหรือคอยตามล้างตามเช็ดให้สามีผมก็ไม่ห้ามนะครับ', 'พรพิฆเณศว์', '2014-11-08 07:27:25'),
