(841, 475, 'เป็นเบอร์ที่ดีมั่กๆอีกเบอร์หนึ่งครับให้จดทะเบียนใช้จนแก่ตายครับ  แล้วอย่าลืมปิดเบอร์อื่นที่เสีย(ในคำทำนายของเบอร์นั้นๆมีอักษรเป็นสีแดงครับ)ซะให้หมดด้วยครับ', 'พรพิฆเณศว์', '2014-11-09 21:54:20'),
(842, 477, 'ใกล้เคียงกันครับ ถ้าเป็นผมจะเอามาใช้ทั้งคู่ แล้วปิดเบอร์เก่าที่เสียทั้งหมด รวมทั้งเบอร์ที่ใช้กับแท็บเล็ตด้วย เพราะให้ผลเช่นเดียวกับเบอร์ที่ใช้โทรครับ', 'พรพิฆเณศว์', '2014-11-16 21:25:10'),
