(847, 480, 'ใกล้เคียงกันมั่กๆ ทั้ง2เบอร์ ต่างกันอยู่นิดหน่อย ที่ 46 กับ 45 เท่านั้นเอง แต่ทั้ง2เบอร์ เด่นที่ ความรัก เสน่ห์ การเงิน อยู่แล้วครับถ้าเป็นผม เลอืกได้จะเลือก  xx9-9641456 ดีกว่า(เพราะเลขสวยด้วยครับ\r\n\r\n', 'พรพิฆเณศว์', '2014-11-19 14:42:39'),
(848, 480, 'ขอบคุณมากครับ ', 'Totoro ', '2014-11-19 18:03:14'),
(849, 482, '099-465-5296 ดีกว่าครับ แต่ผมว่าถ้า2เบอร์นี้มันมีอยู่ในมืออยู่แล้วละก็ อย่าทิ้งมันเลยครับ ให้ใช้คู่กันไป เพียงแต่ว่าหากคุณอยู่ในสถานภาพ โสด ก็ไม่สมควรใช้ 081-664-2963 ครับ', 'พรพิฆเณศว์', '2014-11-21 13:18:44'),
(850, 481, 'จดทะเบียนใช้ยาวยันแก่ตายกันไปข้างได้เลยครับ  ที่สำคัญหาดมีเบอร์ที่เสีย(เบอร์ที่มีจุดบอด..คำทำนายมีตัวอักษรสีแดง)ให้ทิ้งเบอร์นั้นๆเสียด้วยห้ามเอามาใช้คู่กันครับ\r\n', 'พรพิฆเณศว์', '2014-11-21 13:22:56'),
(851, 483, 'ซิม....เสียบใส่เครื่อง...เปิดเครื่องไม่ว่าจัใช้กับแท็บเล็ตหรือโทรศัพท์ ก็ใช้ผลเช่นเดียวกันครับอีกเย่างเบอร์นี้เป็นเบอร์ที่ดีก็จะุให้ผลที่ดีกับคุณครับ เพียงแต่ว่าถ้าคุณมีเบอร์อื่นที่เสียก็ปิดมันซะอย่าเอามาใช้ด้วยกันครับ', 'พรพิฆเณศว์', '2014-11-21 21:41:31'),
