(854, 486, '1.เรื่อวันเดือนปีเกิดจริงๆแล้วไม่ได้มีอะไรเกี่ยวข้องกับเบอร์โทรเลยครับแต่จะไแเกี่ยวข้องกับชื่อและสีของรถที่ใช้มากกว่าครับ \r\n2.0941645992 เป็นเบอร์ที่ดีให้จดทะเบียนใช้จนแก่ตายกันไปข้างหนึ่งเลยครับ \r\n3.ที่ถามว่าจะรวยหรือปล่าว....ทุกคนมีความอยาก..รัก โลภ โกรธ หลง เหมือนกันหมด เอาเป้นว่าคุณใช้เบอร์นี้ไปแล้วจะช่วยให้ชีวิตคุณมีความสุ๘ในการดำเนินชีวิต มันจะดีกว่ากันเยะ(ถ้าคุณรวยแล้วหาความสุขในการดำเนินชีวิตไม่ได้คุณจะอยากได้มันใหมครับ)', 'พรพิฆเณศว์', '2014-11-24 21:39:23'),
