(858, 488, 'ยินดีด้วยครับที่คุณบอกมาทั้งหมดเป็นเบอร์ดีทั้งสิ้น และทุกเรื่องที่ถามมา มีทั้งเรื่องเรียน เงินและความรักที่ดีทั้งหมดเว้นแต่เรื่องเดียวคือเดินทางต่างประเทศ ทุกเบอร์ไม่ได้บอกชัดเจนครับ เพราะถ้าจะได้เดินทางต่างประเทศนั้นจะต้องมีเลข2กลุ่มในเบอร์เดียวกันครับ ซึ่งของคุณไม่มีครับเลยไม่อยากตั้งความหวังครับ', 'พรพิฆเณศว์', '2014-11-28 22:04:55'),
