(884, 504, 'แค่หาเบอร์โทรโดยใช้ผลรวมนี่ก็ผิดตั้งแต่คิดแล้วครับ  สำหรับเบอร์โทรแล้ว ผลรวม และเลขกาลกิณี ไม่มีผลกับเบอร์โทรอย่างที่เขาบอกกันหรือคุณไปอ่านเจอหรอกครับ \"เชื่อข้อมูลที่ผิดพาจิตตกปล่าวๆครับ\"', 'พรพิฆเณศว์', '2014-12-26 17:32:10'),
