(890, 508, '1.เรื่องหลักการของเบอร์โทรนี้ไม่เกี่ยวกับเรื่องดวงดาว/ลัคนา ครับ \r\n2.Xx1 959 3899 ปิดไปซะเถอะครับ ไม่ว่าเบอร์นี้มันจะอยู่กับใครก็ตาม มันก็เสียที่38ครับ \r\n3.อย่างที่บอกในข้อ 1 นั่นแหละครับ คุณเรียนรู้ศาสตร์อย่างหนึ่งแต่เอามาใช้กับอีกอย่างมันไม่ชัวร์ครับ คือการคำนวนและการแก้ต่างๆนั้นทางที่ถูกที่ดีที่สุดคือ วิธีคำนวนเพื่อแก้จะคำนวนแตกต่างกัน เช่นชื่อของเจ้าชะตา/บ้าน/รถ/เบอร์โทร/หาเฤกษ์ หรืออื่นๆ จะใช้วิธีคำนวนเพื่อแก้คนละอย่างกันครับ อย่างที่คุณบอกมาข้างตันนั้นจะเอาไปใช้ได้กับชื่อ แต่ก็ต้องหาสมพงษ์กับนามสกุลและวันเดีือนปีเกิดอีกทีซึ่งก็จะมีข้อควรระวังสำหรับกำลังของนามสกุลและชื่อลึกเข้าไปอีกครับ \r\n4.เรื่องบางเรื่องยึดตำราแต่เล่มสองเล่มก็ใช่ว่าจัถูกเสมอไปครับ ทางที่ดีที่สุดคือประสบการณ์ตัองคู่ไปกับตำราและสถิติครับ\r\n5.โดยพื้นฐานผมเองเรียนรู้และสัมผัสเรื่องพวกนี้มาจากความไม่เชื่อ(คือจับผิดหมอดูมาตลอด)สุดท้ายมันจึงเป็นสถิติไปโดยตัวของมันเอง เลยทำให้ผมแยกแยะทุกเรื่องได้ แต่ถ้าผมเชื่อทุกเรื่องที่เขาเขียนต่อๆกันมาผมก็จะไม่รู้อะไรไปมากกว่าที่เขาบอกเรามาครับ....ฉนั้นทางที่ดีที่สุดคือน้ำต้องไม่เต็มแก้วอยู่เสมอครับแล้วแยกแยะสังเกตุจดบันทึกแล้วมันจะกระจ่างกว่านี้ครับ\r\n\r\nสำหรับผมแล้วโหราศาสตร์ม้นก็เป็นวิทยาศาสตร์เชิงปรัชญาได้เหมือนกันครับถ้าเราเข้าถึงมันจริงๆครับเพียงแต่ต้องใช้เวลากับการสังเกตุและทำสถิตินานหน่อย ซึงผิดกับวิทยาศาสตร์ทั่วไปเช่น คุณเอาลวดแม็กนีเซี่ยมมาเส้นแล้วเอาน้ำหยดใส่มันก็จะเกิดประกายไฟให้คุณเห็นทันตาทันใจครับ', 'พรพิฆเณศว์', '2015-01-04 22:53:23'),
