(895, 511, 'จะทะเบียนใช้ยาวไปเลยครับ(ยันแก่ตายไปข้างหนึ่งละครับ) ส่วนที่ถามว่ามีข้อควรระวังนั้นคือ ถ้าคุณใช้เบอร์นี้ 0844916542 แล้ว หากคุณมีเบอร์อื่นเบอร์ไดก็ตามไม่เว้นแม้แต่เบอร์ที่ใส่ใว้ในแท็บเล็ต ให้เอามาคีย์ดูคำทำนายทุกเบอร์หากเบอร์นั้นๆ ในคำทำนายมีตัวอักษรเป็นสีแดงแม้แต่ตัวเดียว ให้ปิดทิ้ง(เลิกใช้)เบอร์นั้นๆซะอย่าเอามาใช้ด้วยกัน และก็เช่นกันหากเบอร์นั้นๆ ในคำทำนายไม่มีตัวอักษรเป็นสีแดง ก็ให้ใช้คู่กันไปได้เลยครับ เว้นอต่เบอร์ดีนั้นๆ ดันมี 63/36 อยู่ด้วย หย่าปิดทิ้งควรเอาไปให้ใครก็ได้ที่เขามีครับครัว(สถานภาพสมรส)ใช้ เพราะณ เวลานี้คุณยังไม่สมควรใช้ 63/36 เนื่อบจากจะมีผลข้างเคียงในเรื่องชีวิตคู่(ไม่สมหวังในความรัก)กับคุณ( ณ เวลานี้ครับ)แต่อนาคตนั้นจะใช้ได้หรือไม่นั้นขึันอยู่กับสถานะของคุณว่า โสด หรือสมรส ครับ', 'พรพิฆเณศว์', '2015-01-10 00:12:47'),
(896, 512, '61 มันก็บอกอยู่แล้วครับว่าช้าในเนื่องความรัก(แต่ถ้าเจอแล้วจะมั่นคงมากๆ)อีกอย่าง คนที่มี 61 เลือกมาก ผมว่าคุณไม่เลือกเองซะมากกว่ามังครับ  และที่สำคัญหากชาติก่อนคุณไม่เคยได้ทำบุญร่วมชาติกับใครมาก่อน คุณคิดว่ามันจะหาง่ายในชาตินี้ใหมล่ะครับ บางอย่างถ้ามันยังไม่กึงเวลาของมันผมว่าก็อย่าไปกังวลใขว่คว้าเลยครับ การที่มีเบอร์ที่ดีอยู่กับตัว ยังไงซะมันจะช่วยทำให้เราใช้ชีวิตอย่างเป็นสุข กว่าคนอื่นอยู่แล้วผมว่ามันก็น่าจะดีอยู่แล้วนะครับ.....สมมุติว่า  \r\n1.พรุ่งนี้คุณเกิดไปเจอคนที่ถูกใจ..ชอบ..คบกันดีเลยได้แต่งกันไปหลังจากนั้นเขาก็ทะเลอะกับคุณทุกวันด้วยเรื่องต่างๆนาๆ...  \r\n2.อีกสามวันคุณได้เจอคนหนึ่งที่ถูกใจและเขาก็รักคุณมากสุดท้ายก็แต่งงานกันไป แล้วเขาก็รักคุณทนุถนอมคุณมากยิ่งขึ้น คอยดูแลเอาใจใส่ครอบครัว จำแก่เฒ่า   \r\n3.คุณจะเลือกข้อใหนครับ ระหว่าง ข้อ 1.  กับข้อ 2.', 'พรพิฆเณศว์', '2015-01-12 23:07:51'),
