(2070, 709, 'เคยซื้อเบอร์อาจารย์ ใช้มาตั้งแต่ปี2013\r\nตอนเปลี่ยนได้งานที่รายได้โดดขึ้น หลังจากนั้นมีคดีความและตอนนี้ตกงานหนึ่งปี อยากปรึกษาค่ะ', 'นารี', '2017-12-25 15:31:40'),
(2071, 969, 'อย่าเปลี่ยนครับเนื่องจากช่วงชะตาชีวิตของแต่ละคนต่างกัน...แต่เลขที่ดีจะช่วยพยุงผ่อนหนักให้เป็นเบาในช่วงชะตาชีวิตตกำ...แต่หากพ้นแล้เลขที่ดีก็จะช่วยส่งผลดีให้ถึงที่สุดในช่วงนั้นๆได้ครับ', 'พรพิฆเณศว์', '2017-12-25 17:40:57'),
